import React from 'react';
import TextField from '@mui/material/TextField';
import SendIcon from '@mui/icons-material/Send';
import './textbox.css';

const MyTextBox = () => {
  return (
    <div>
    <TextField
      className='box'
      multiline
      label="Enter Text"
      InputProps={{
        style: {
          color: 'white',
          width: '600px', // Set the desired width here
        },
      }}
    />
    </div>
  );
};

export default MyTextBox;
